import React from "react";

const App = () => {
  return (
    <>
      <div className="main_div">
        <div className="main">
          <h1>ToDo List</h1>
        </div>
        <input type="text" placeholder="Add an Items" />
        <button>+</button>
        <ol>
          <li>buy</li>
          <li>buy</li>
          <li>buy</li>
          <li>buy</li>
          <li>buy</li>
          <li>buy</li>
          <li>buy</li>
          <li>buy</li>
        </ol>
      </div>
    </>
  );
};

export default App;
